import '../styles/Banner.css'

function Banner() {
    return (
        <div className='kasa-banner'>
            <img src={logo} alt='Kasa' className='kasa-logo' />
            <nav className='kasa-banner'>
                <p className='nav-banner'>{title}</p>
            </nav>
        </div>
    )
}

export default Banner
